import "./styles.css";
import {
    BrowserRouter as Router,
    Routes,
    Route,
} from "react-router-dom"
import Home from "./pages/Home";
import About from "./pages/About";
import Navbar from "./components/Navbar";


export default function App({handleDelete}) {
    //state

    //comportements

    //affichage
    return (
        <div className="App">
            <Router>
                <div>
                    <Navbar/>
                    <Home delete={handleDelete}/>
                    <Routes>
                        <Route index Component={Home(handleDelete)}/>
                        <Route path="/about" Component={About}/>
                    </Routes>
                </div>
            </Router>
        </div>
    );
}
